import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import LoginScreen from './components/LoginScreen';
import ClinicianProfile from './components/ClinicianProfile';
import UserProfile from './components/UserProfile'; // Make sure this import is correct

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LoginScreen />} />
        <Route path="/clinician-profile" element={<ClinicianProfile />} />
        <Route path="/patient-profile/:username" element={<UserProfile />} />
      </Routes>
    </Router>
  );
};

export default App;
